import info from '../data/info.json';
import Pokemon from './Pokemon';

const Pokelist = (props) => {
    const eachClub = props.clubs.map((item, i) => {
        return (
            <li key={i}>
                <Club especClub={item} />
            </li>
        )
    });

  return (
    <div>
      <ul>
       {eachClub}
      </ul>
    </div>
  );
}

export default Pokelist;
